export default function About() {
  return (
    <div className="min-h-screen p-6 animate-fadeInUp">
      <h1 className="text-3xl font-bold mb-4">About weFOUNDit</h1>
      <p className="text-gray-600 max-w-2xl">
        weFOUNDit is a community-driven platform that helps people
        reconnect with their lost belongings and report found items.
        Our mission is simple: reduce loss and bring things back home.
      </p>
    </div>
  );
}
